import React from 'react'
import ProductList from '../Products/ProductList';
import {connect} from 'react-redux';
// import {Products} from '../../data';
import './Men.css';

const Men = ({Products, match}) => {
    // console.log(props)
    const path = match.url.slice(1);
    console.log(match);
    console.log(Products);
    // const test = Products.map(list => list)
    // console.log(test);
    const filteredMen = Products.filter(list => list.gender === path);
    console.log(filteredMen);
    return (
        <div className="container men-products">
            <ProductList items={filteredMen}/>
        </div>
    )
}

const mapStateToProps = (state) => {
    return {
        Products: state.Products
    }
}

export default connect(mapStateToProps)(Men);
